import Navbar from "../components/Navbar"
import axios from "axios";

function Index () {
  return (
    <div>
      <h1>Hello page here !!!</h1>
    </div>
  )
};

Index.getInitialProps = async () => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/posts")
  const {data} = res;
  console.log(data[0])
  return {posts: data};
};

export default Index;
